import React from 'react'
import { useSelector } from 'react-redux'

export function ChatHeader({ roomId }) {
    const rooms = useSelector(state => state.rooms.rooms)

    const room = rooms.find(room => room.id === roomId)

    return (
        <div className="">
            {room.name}
        </div>
    )
}
